import React from 'react';

const onClick = (event) => {
    event.preventDefault();
    window.history.pushState({}, '', href);
};

const Link = ({className, href, children}) => {
    return (
        <a onClick={onClick} className={className} href={href}>{children}</a>
    );
};

export default Link;
